CREATE MATERIALIZED VIEW stream_query AS SELECT t_2.o_comment AS col_0, t_2.o_orderpriority AS col_1, '1oIAOQLXCZ' AS col_2, ('kApvNdDX6g') AS col_3 FROM orders AS t_2 WHERE ((REAL '224') <> (142)) GROUP BY t_2.o_orderpriority, t_2.o_comment, t_2.o_orderstatus;
DROP MATERIALIZED VIEW IF EXISTS stream_query;
